import React from 'react';
import './Header.css';


const header = (props) => {
  return <header className="App-header">
  <h1>
    Untitled Motivation App 
  </h1>
  <a
    className="App-link"
    href="https://patmifsud.com"
    target="_blank"
    rel="noopener noreferrer"
  >
    Learn More
  </a>
  </header>
};

export default header;
